package rosalind.teman;

public class TranslatingRNAIntoProtein {
	
	public static void main(String[] args) {
		String RNA = "";
		String protein  = "";
		for(int i = 0 ; i < RNA.length(); i+=3){
			String key = RNA.substring(i,i+3);
			String code = RNATable.table.get(key);
			if(!"Stop".equals(code)){
				protein += code;
			}
		}
		System.out.println(protein);
	}	
}
